import { Fragment } from "react";

import mealsImage from "../../assets/meals.jpg";
import styles from "./Header.module.css";

const Header = (props) => {
  return (
    <Fragment>
      <header className={styles.header}>
        <h1>GoodFood</h1>
        <button>Cart</button>
      </header>
      <div>
        <img src={mealsImage} alt="A table full of Food"></img>
      </div>
    </Fragment>
  );
};

export default Header;
